INSERT INTO `blog__post_translations` VALUES (3,4,'en','Fault Logging System','fault-logging-system','<p>We are currently designing a fully featured fault logging system that will enable you to log faults that you find on DigiQRP,&nbsp;</p>\r\n\r\n<p>Stay Tuned for updates.</p>'),(4,5,'en','About DigiQRP','about-digiqrp','<p>This is about the components / software used to build this site, we are using a custom fork of the AsgardCMS system that is easy to use our of the box.</p>\r\n\r\n<p>The custom fork of the AsgardCMS is a full-featured modular multilingual CMS built on top of the Laravel framework, we have upgraded this to use the very latest version of Laravel (8.x) it has the following highlights. We also have in place a easy way to deploy your web application to any environment. We use three environments:</p>\r\n\r\n<table align=\"left\" border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"background-color:#e6e6fa;border-style:hidden;\">\r\n	<thead>\r\n		<tr>\r\n			<th scope=\"col\">Environment</th>\r\n			<th scope=\"col\">\r\n			<div style=\"background:#eeeeee;border:1px solid #cccccc;padding:5px 10px;\">Notes</div>\r\n			</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Development&nbsp;</td>\r\n			<td>This environment is our local machine used for development, we currently use a combination or Laravel Homestead and PHP Storm with Mysql 5.7 and PHP 7.4</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Staging</td>\r\n			<td>The pre-production site that is used to test on the same dedicated web server prior to release to the production site. Git repository source ( Develop )</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Production</td>\r\n			<td>The live site running PHP 7.4, mysql 5.7 and Laravel 8, Git repository source is Master branch.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2>Fully Responsive</h2>\r\n\r\n<p>The default themes are based on Bootstrap, which is fully responsive. Comfortably browse the site on any device!.</p>\r\n\r\n<h2>PHP 7.0</h2>\r\n\r\n<p>Built on PHP 7.0 with modern coding standards. AsgardCms runs perfectly on php7, proof is this site runs on php7 and is an AsgardCms powered site, on this site we are using PHP 7.4.</p>\r\n\r\n<h2>Launch Ready&nbsp;</h2>\r\n\r\n<p>Launch your website in days and not months with the rapid application development setup.</p>\r\n\r\n<h2>Minimum System Requirements</h2>\r\n\r\n<p>To be able to run AsgardCMS your host / develpment environment&nbsp;has&nbsp;to meet the following requirements:</p>\r\n\r\n<ul>\r\n	<li>PHP 7.1 or higher ( 7.4 recommended )&nbsp;</li>\r\n	<li>PDO PHP Extension</li>\r\n	<li>cURL PHP Extension</li>\r\n	<li>OpenSSL PHP Extension</li>\r\n	<li>Mbstring PHP Extension</li>\r\n	<li>Tokenizer PHP Extension</li>\r\n	<li>Mcrypt PHP Extension</li>\r\n	<li>GD PHP Library</li>\r\n	<li>MySql 5.6</li>\r\n	<li>One of the following cache drivers:&nbsp;<code>memcached</code>,&nbsp;<code>redis</code>,&nbsp;<code>apc</code>. (defaults to&nbsp;<code>array</code>)</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>'),(5,6,'en','Developing a Blog Module','developing-a-blog-module','<p>I wanted to develop a proper blog module for the CMS and after sitting down and thinking this though for a while, I came up with the initial design, this is what you are viewing now.</p>\r\n\r\n<p>This fits really well with the Theme module in use and finally we now have a blogging module, this also got me thinking about the downloads support and a forum that I will develop as an initial design to see how this goes.</p>\r\n\r\n<p>There are a few minor bugs but this is working as expected at the moment.</p>\r\n\r\n<p>We have several documents that we need to add that we are working on at the moment to get you started with Laravel development as soon as these are release we will update the site.</p>\r\n\r\n<p><u><strong>New Web Image Formats</strong></u></p>\r\n\r\n<p>The support has been added to support webp images now, so that we can use modern image types to decrease page load times further, there was a minor bug when the system generated the thumbnails but this has been resolved with a quick fix to the transformation code, what this does its as you upload an image then two thumbnails are generated for use across the site and the admin area, these are queue jobs that take place in the background to speed the upload process.</p>\r\n\r\n<p>The method was not supporting &quot;webp&quot; as a file format a simple modification to the supported file types was all that was required, the media library is now in proper shared area so that between releases the media library is preserved and also protected from unwanted tampering.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We have uncovered an issue with the editing component that prevents the embedding of images, we are workign on this issue at the moment.</p>'),(6,8,'en','OSX Development Environment','osx-development-environment','<p>This is how to develop using OSX</p>'),(7,9,'en','WSJTX Bridge','wsjtx-bridge','<p>this is a PHP based bridge</p>'),(8,10,'en','Mac Logger DX','mac-logger-dx','<p>MacLoggerDX -&nbsp;the&nbsp;Mac Ham Radio Logbook choice in 130 countries....</p>\r\n\r\n<p>Organizing and filtering the spots from your favourite DX Cluster for DXing, casual Contesting or rag-chewing. MacLoggerDX supports more than a hundred radios, automatically tuning to the spots you are interested in, swinging your beam around. Alerting you to rare contacts or Band Openings and looking up, displaying on 2D, 3D and Satellite Maps and logging your contacts to a super fast sql database. MacLoggerDX can also text or email you when the Bands are open or that rare DX is spotted. Awards Tracking, Band Activity, Schedules, Memories, QSL Generation, ADIF import, export, Club Log integration, eQSL, LoTW, IOTA Confirmations and much more.</p>\r\n\r\n<p>This is the software I use for logging on the Macintosh, it uses a proper SQL database and integration onto DigiQRP was a trivial task, WSJTX does have its own log that you can import in addition to full intergartion with WSJTX, on the Raspberry PI we have a bridge that sends the data from the Raspberry PI to MacLogger and also a similar bridge that can log direcrly into DigiQRP.</p>\r\n\r\n<p>I have used this for many years and it has always delivered, the support from the author&nbsp;Don Agro VE3VRW is excellent, you can also control the Xeigu G90 from this software also.</p>\r\n\r\n<p>Down load a Trial from&nbsp;<a href=\"https://dogparksoftware.com/MacLoggerDX.html\" target=\"_blank\">Dog Park Software</a></p>'),(9,11,'en','Latest News','latest-news','<p>The system has now been extended to include many nice features, the solar reports are proving useful when predicting the best operating times which is useful in itself. We have also extended the blog module to now carry&nbsp;a category and restrict flag so that we can limit areas of the site to specific pages or blog entries.&nbsp;</p>\r\n\r\n<p>Many of the issues with the original design are now resolved, these focused around images and media that were not being preserved across releases of the core code, We wil be updating the CK editor component to resolve an issue with embedded images.</p>\r\n\r\n<p>The downloads section is the next development sprint, following this will be the creation of the base components from the fork of the original that has provided a great source of input into the design process.&nbsp;</p>\r\n\r\n<p>These wil be available via github and also packagist so that the components along with an installer can be downloaded and a base system installed.</p>\r\n\r\n<p>There are still much to do on the basic CMS design as we pull insperation from other CMS systems, thinking about plugins and modules along with themes drives development.</p>\r\n\r\n<p><u><strong>System Logging</strong></u></p>\r\n\r\n<p>We are at the moment using simple single file logging this is going to be replaced with a module that will expose the log files to the admin area to aid problem detection and the adition of active app alerts for issues and performance monitoring.</p>\r\n\r\n<p><u><strong>Admin Area</strong></u></p>\r\n\r\n<p>We are working on a new template for the admin area, the original is a good fit but we can do so much better, we will also have the ability to switch themes for the backend, we are also designing the ability to switch themes on a user / role basis, and exposing the registration and login components to the front end template.</p>\r\n\r\n<p><u><strong>Site Template</strong></u></p>\r\n\r\n<p>This is also being extended to incluse the ability to edit articles from the front end and a realtime message systems to enable logged in users to communicate via the site.</p>\r\n\r\n<p><u><strong>Logbook</strong></u></p>\r\n\r\n<p>We have also fixed an issue with the logbook view on mobile, now the table columns are hidden based on the displays size, this ensures that the table always looks ok on mobile, tablet and desktops. There are more options to investigate here and we will be opening up the full data set soon.</p>\r\n\r\n<p>&nbsp;</p>'),(10,12,'en','PHPStorm','phpstorm','<p>This is without a doubt the best PHP developmnent IDE on the market today,&nbsp;</p>\r\n\r\n<h3>Built In Developer Tools</h3>\r\n\r\n<p>Perform many routine tasks right from the IDE, thanks to the Version Control Systems integration, support for remote deployment, databases/SQL, command-line tools, Docker, Composer, REST Client, and many other tools.</p>\r\n\r\n<h3>All the Tools</h3>\r\n\r\n<p>The editor actually &#39;gets&#39; your code and deeply understands its structure, supporting all the PHP language features for modern and legacy projects. It provides the best code completion, refactorings, on-the-fly error prevention, and more.</p>\r\n\r\n<p>Download from&nbsp;<a href=\"https://www.jetbrains.com/phpstorm/\" target=\"_blank\">JetBrains</a></p>'),(11,13,'en','New Features','new-features','<p>We are working now on the logbook area to extend this further, in the admin area we are exposing the DXCC country lookup table and adding more functionality so that we are able to look the country data up realtime.</p>\r\n\r\n<p>The DXCC list is quote sparse and we intend to extend this and migrate the data into a true ISO country code table.</p>\r\n\r\n<p>The dynamic elements are to recover the country data as the row is displayed, this can be acehived with a relationship between the log entries table and the countries table, we are also enabling the Call sign lookup API, this api wil be made available to a limited number of users so that they took can perform callsign lookups, the technical challeange were is caching so we are able to update the local db with results from various providers,&nbsp;</p>\r\n\r\n<p>We will be using a redis cluster to achive this as this is much faster than a native DB call when a lok of requests are being made, this does require some research to that we deliver the fastest API possible.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Site Meta Keywords and Description</strong></p>\r\n\r\n<p>We have now added the settings to the core module that exposes the site meta keywoards and description, these are important settings and are used by search engines when they scan your site, we will also extend the pages and blogging area to also carry their own meta keywords.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Regards Mark Gregory G4LCH</p>\r\n\r\n<p>&nbsp;</p>'),(12,14,'en','System Development Environment','system-development-environment','<p>This is a short blog posting on how to setup your server to support development, this can be on the same host system or a toally different server.</p>\r\n\r\n<p>I will also discuss how to deploy your code updates to both a production and a staging environment.</p>');
