INSERT INTO `page__page_translations` VALUES (1,1,'en','Welcome','welcome','1','<p>We are currently the process of developing a lot of interesting projects both software and hardware, the first being this new site. We do intend to release this as a framework for other radio amateurs to build great web sites.&nbsp;</p>\n\n<p>This frame work will makes it simple to make a high quality responsive website in record time using supplied templates or you can of course design your own, this site is fully responsive so that you can use it on a mobile or table device.</p>\n\n<p>The purpose of the site is to focus&nbsp;on digital modes and software including VOIP and other useful tools to use.&nbsp;</p>\n\n<p>The new online logbook is now available using the menu above,&nbsp; this displays what is possible using low power, as you will see long distance communications are possible with quite low power and a modist vertical antenna system.</p>\n\n<p>All of the contacts were made using a max power of 10&nbsp;watts with FT8 from the Xeigu G90 into a multi band vertical antenna. The sofwtare in use is WSJTX using a&nbsp;custom FLRIG&nbsp;combination.</p>\n\n<p>We co-authored the Xeigu G90 for FLRIG and its now available for download on their site.&nbsp; The operating system of choice is OSX but we also from time to time use a 4GB Rasperry PI 4 with SSD boot to run the software as well, I have written custom drivers to control the cooling on the PI, we will write this up at sometime of your interested please contact me.</p>\n\n<p>The log solution for the site uses a combination of MacLogger DX and with the PI a custom WSJTX bridge that logs directly into the site, the updates are made realtime to keep the log current. We have also added the longest contacts made to date using the Xeigu G90 with a graphic representation of the country, the logbook contains all of the required data to perform this with a lookup table to convert dxcc identifiers / country names to a corresponding flag.</p>\n\n<p>Solar Data is also now being recovered from N0NBH, every 4 hours the server contacts the N0NBH server and retreives the latest solar data, we store these reports in a SQL database, this is to enable us when enough data is recovered to see trends in solar conditions against current propergation. Once enough data is recovered we will expore making this historic data available.</p>\n\n<p>Regards</p>\n\n<p>Mark G4LCH</p>','Home page',NULL,NULL,NULL,NULL,NULL,'2021-04-11 05:29:04','2021-04-30 08:42:51'),(3,3,'en','Downloads','downloads','1','<p>Downloads are will be divided into two areas:</p>\n\n<ul>\n	<li>Public&nbsp;</li>\n	<li>Private</li>\n</ul>\n\n<p><strong>Public Downloads</strong></p>\n\n<p>These are general downloads that can be tools and full applicatons that we support.</p>\n\n<p><strong>Private Downloads</strong></p>\n\n<p>These are very specific downloads only available to our members these this includes any of the templates and the framework we are working on at the moment.</p>\n\n<p>Downloads are will be divided into two areas:</p>\n\n<ul>\n	<li>Public&nbsp;</li>\n	<li>Private</li>\n</ul>\n\n<p><strong>Public Downloads</strong></p>\n\n<p>These are general downloads that can be tools and full applicatons that we support.</p>\n\n<p><strong>Private Downloads</strong></p>\n\n<p>These are very specific downloads only available to our members these this includes any of the templates and the framework we are working on at the moment.</p>',NULL,NULL,NULL,NULL,NULL,NULL,'2021-04-12 06:16:12','2021-04-12 10:14:41'),(4,4,'en','Registration','registration','1','<p>The system registratioin system will open soon, this will provide some neat feautures such as a forum, private downloads and messages.</p>\n\n<p><strong>Messaging</strong></p>\n\n<p>This will permit you to message other members directly and the systems administrators / developers for assistance, build groups focused on your specfic needs or the needs of your group.</p>\n\n<p><strong>Forum</strong></p>\n\n<p>This is the most iinteresting development and will not be an easy task, we are not going. to provide just any old forum but one modeled on Lotus Notes and Domino with replication, anyone who has ever worked with this software understands the true power of this schema.&nbsp; In short this will allow you to not only syncronise your documents, responses and their responses but also achive this at a site level so that multiple sites can replicate a specific subset of data to their own system and publish this in their own right.</p>\n\n<p>We have not seen any other system attempt this bold task to date buut having worked for Lotus Development Corporation we have a real insight into how to do this properly.</p>\n\n<p>This will act as a sub system under the control of a web server / network stack.&nbsp;</p>',NULL,NULL,NULL,NULL,NULL,NULL,'2021-04-12 06:16:45','2021-04-12 10:13:52'),(6,6,'en','logbook','logbook','1','<h3>Current Digital Mode Log Entries</h3>\n\n<p>These are live multi-band low power ( max 10 watts ) logbook entries for G4LCH using Xeigu G90 and multi-band vertical.</p>',NULL,NULL,NULL,NULL,NULL,NULL,'2021-04-12 10:26:02','2021-04-12 10:26:27'),(7,7,'en','Xeigu G90','xeigu-g90','1','<p align=\"left\" style=\"padding:3px\">The new G90 from Xiegu Technology is a 20 Watt AM/CW/SSB HF amateur transceiver with SDR architecture and an inbuilt ATU. It replaces the very successful and highly-regarded X108G in the company&#39;s lineup.&nbsp; The G90 is an entirely new design which shares nothing with its predecessor.</p>\n\n<p align=\"left\" style=\"padding:3px\">The full colour front panel LED is larger than that on the X108G, and now incorporates a spectrum display.</p>\n\n<p>Other refinements include variable software-defined filtering, a CW decoder, and an interface that will allow the G90 to be controlled by a PC as well as linking to the GSOC panadapter.&nbsp; A multi-function digital microphone is supplied as standard, allowing direct operation of many transceiver functions without the need to touch the front panel.<br />\n<br />\nAll G90s are now supplied from the factory with a power cable with a blade fuse.</p>\n\n<h2>Xiegu G90 Key Features</h2>\n\n<ul style=\"padding:0px; color:#9a9a9a; list-style-position:inside !important; list-style-image:initial; list-style-type:disc !important; overflow:hidden; font-family:Arial, Helvetica, sans-serif; font-size:12px; font-style:normal; font-variant-ligatures:normal; font-weight:700; text-align:left; white-space:normal; background-color:#ffffff; text-decoration-thickness:initial; text-decoration-style:initial; text-decoration-color:initial; margin-left:10px\" type=\"disc\">\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">SDR architechture</li>\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">45 mm high brightness color TFT LCD screen</li>\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">Frequency coverage 0.5-30MHz, SSB/CW/AM</li>\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">Software-defined filtering</li>\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">Detachable Front Panel/Display Unit</li>\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">IF channel AGC for constant gain</li>\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">Switchable preamplifier &amp; signal attenuator</li>\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">Built-in wide range ATU</li>\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">Twin VFO for split operation</li>\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">PC/Panadapter interface</li>\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">Front and rear handles</li>\n</ul>\n\n<ul style=\"padding:0px; color:#9a9a9a; list-style-position:inside !important; list-style-image:initial; list-style-type:disc !important; overflow:hidden; font-family:Arial, Helvetica, sans-serif; font-size:12px; font-style:normal; font-variant-ligatures:normal; font-weight:700; text-align:left; white-space:normal; background-color:#ffffff; text-decoration-thickness:initial; text-decoration-style:initial; text-decoration-color:initial; margin-left:10px\" type=\"disc\">\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">RF Output power adjustable between 1 &amp; 20 Watts</li>\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">MOS RF output transistors for superior performance</li>\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">High VSWR protection circuitry for output stage</li>\n	<li style=\"padding:0px; float:none; list-style:inside disc !important; color:#000000; line-height:20px\">Inbuilt CW&nbsp;<span class=\"SpellE\" style=\"padding:0px\">keyer</span>&nbsp;with rate adjustment</li>\n</ul>\n\n<h2 style=\"padding: 0px; float: none; color: rgb(0, 0, 0); line-height: 20px; list-style: inside disc !important;\">Xiegu G90 Specifications</h2>\n\n<ul>\n	<li>Stray radiation rejection:&nbsp;&nbsp;&ge; 40&nbsp;dB</li>\n	<li>Receive frequency range:&nbsp;0.5 - 30 MHz</li>\n	<li>Transmitting frequency range:&nbsp;All HF Amateur bands (including WARC bands). NB: 60 m coverage is 5330.5 - 5405 MHz</li>\n	<li>Operating modes:&nbsp;SSB (J3E)&nbsp;CW (A1A)&nbsp;AM (A3E)</li>\n	<li>Frequency Stability:&nbsp;&plusmn; 2 ppm (power on + 30 minutes) @ 0 &deg; C - 55 &deg; C</li>\n	<li>Dynamic range:&nbsp;90 dB</li>\n	<li>RF output power (max): 20W</li>\n	<li>Spurious response rejection:&nbsp;&ge; 50&nbsp;dB</li>\n	<li>Carrier suppression:&nbsp;&ge; 50&nbsp;dB</li>\n	<li>Sideband suppression:&nbsp;&nbsp;&ge; 50&nbsp;dB</li>\n	<li>Antenna impedance:&nbsp;50 &Omega;</li>\n	<li>Antenna connector: S0239</li>\n	<li>Operating voltage:&nbsp;&nbsp;12.5 V - 16.5 V DC</li>\n	<li>Current draw:&nbsp;&nbsp;Receiving: 0.75 A (max)&nbsp;&nbsp;Transmitting: 8 A (max)</li>\n	<li>Dimensions:&nbsp;120 x 45 x 210 mm</li>\n	<li>Weight (incl. mic):&nbsp;&plusmn; 1700 g</li>\n</ul>',NULL,NULL,NULL,NULL,NULL,NULL,'2021-05-02 07:56:45','2021-05-03 17:25:19');
